  grid-area: ads;
  border-radius: 10px;
  background: var(--grey-light);
  /* background-image: url("/data.jpg"); */
  /* background-position: cover; */
  & img{
    display: block;
    object-fit: cover;
    height: auto;

  }
`

export default  Ads
